<script>
    document.addEventListener("DOMContentLoaded", function() {
        var printButton = document.getElementById("printButton");

        printButton.addEventListener("click", function() {
            var printWindow = window.open('', '', 'width=800,height=600');
            printWindow.document.write('<html><head><title>Imprimir Tabla</title>');
            printWindow.document.write('<style>');
            printWindow.document.write('body { font-family: Arial, sans-serif; margin: 20px; }');
            printWindow.document.write('.container { max-width: 800px; margin: 0 auto; }');
            printWindow.document.write('.header { text-align: right; font-size: 15px; font-weight: bold; margin-bottom: 20px; }');
            printWindow.document.write('.asunto { text-align: right; font-size: 15px; font-weight: bold; }');
            printWindow.document.write('.dispositivos { text-align: center; font-size: 15px; font-weight: bold; }');
            printWindow.document.write('.section { margin-bottom: 20px; }');
            printWindow.document.write('.destinatario { margin-bottom: 40px; font-weight: bold; }');
            printWindow.document.write('.section p { line-height: 1.6; }');
            printWindow.document.write('.header-image, .footer-image { max-width: 100%; height: auto;}'); // Estilos para las imágenes
            printWindow.document.write('.footer-image {');
            printWindow.document.write('  position: fixed;');
            printWindow.document.write('  bottom: 0;');
            printWindow.document.write('  left: 0;');
            printWindow.document.write('  align-items: flex-end;');
            printWindow.document.write('}');
            printWindow.document.write('table.data-table { border-collapse: collapse; width: 100%; margin-top: 20px; }');
            printWindow.document.write('table.data-table th, table.data-table td { border: 1px solid #ddd; padding: 8px; text-align: left; }');
            printWindow.document.write('table.data-table th { background-color: #f2f2f2; }');
            printWindow.document.write('.signature { margin-top: 40px;  padding-top: 10px; text-align: center;  font-weight: bold; }');
            printWindow.document.write('</style></head><body>');
 printWindow.document.write('<img class="header-image" src="data:image/jpeg;base64," alt="" >');
            printWindow.document.write('<br>');
            printWindow.document.write('<br>');
            printWindow.document.write('<div class="container">');
            printWindow.document.write('<div class="header">Escuinapa, Sinaloa {{$datosServicio->fechaServicio}}</div>');
            printWindow.document.write('<div class="asunto">Asunto: Servicio de {{$datosServicio->accion->nombreAccion}} </div>');
            printWindow.document.write('<br>');
            printWindow.document.write('<div class="destinatario">Tipo de servicio: {{$datosServicio->tipoServicio->nombreTipoServicio}} en el área de {{$datosServicio->area->nom_numArea}} </div>');
            printWindow.document.write('<div class="section"><p>{{$datosServicio->accion->nombreAccion}}</p></div>');
            printWindow.document.write('<div class="section"><p>{{$datosServicio->descripcion}}</p></div>');
            printWindow.document.write('<div class="section"><p>Con las observaciones de: {{$datosServicio->observaciones}}</p></div>');
            printWindow.document.write('<div class="dispositivos">Dispositivos asociados</div>');
            // Insertar la tabla dentro del contenido del documento
            printWindow.document.write('<table class="data-table">');
            var tableRows = document.getElementById('tabla-dispositivos').rows;
            for (var i = 0; i < tableRows.length; i++) {
                var cells = tableRows[i].cells;
                printWindow.document.write('<tr>');
                for (var j = 0; j < cells.length; j++) {
                    printWindow.document.write('<td>' + cells[j].innerHTML + '</td>');
                }
                printWindow.document.write('</tr>');
            }
            printWindow.document.write('</table>');

            printWindow.document.write('<div class="signature">___________________________<br></div>');
               printWindow.document.write('<img class="footer-image" src="data:image/jpeg;base64," alt="" >');
            printWindow.document.write('</div></body></html>');
            printWindow.document.close();
            printWindow.print();
        });
    });
</script>

